import React from "react";
import Container from "@mui/material/Container";
import Input from "@mui/joy/Input";
import Grid from "@mui/joy/Grid";
import Typography from "@mui/material/Typography";
import Button from "@mui/joy/Button";
import { useNavigate, redirect, Form } from "react-router-dom";
import Divider from "@mui/material/Divider";
import TextField from "@mui/material/TextField";
import List from "@mui/material/List";
import ListItem from "@mui/material/ListItem";

export default function Appartamenti() {
  const navigate = useNavigate();
  return (
    <Container
      style={{
        display: "flex",
        alignItems: "center",
        justifyContent: "center",
        height: "100vh",
        width: "100vw",
      }}
    >
      <Container
        style={{
          display: "flex",
          alignItems: "center",
          justifyContent: "center",
          height: "95vh",
          width: "100vw",
          backgroundColor: "rgb(203, 231, 253)",
          borderRadius: "5vh",
        }}
      >
        <Grid
          container
          spacing={1}
          justifyContent="center"
          alignItems="center"
          sx={{ flexGrow: 1 }}
        >
          <Grid
            container
            direction="column"
            sx={{ flexGrow: 1 }}
            style={{
              display: "flex",
              alignItems: "center",
              justifyContent: "center",
              height: "90vh",
              width: "35vw",
            }}
          >
            <Grid
              style={{
                height: "10%",
              }}
            >
              <Typography
                variant="h4"
                color="rgb(0, 76, 134)"
                sx={{ fontWeight: "bold" }}
              >
                I miei appartamenti
              </Typography>
            </Grid>
            <Grid
              container
              style={{
                height: "90%",
                width: "90%",
                backgroundColor: "rgb(44, 135, 50)",
                overflow: "auto",
              }}
            >
              <Grid
                style={{
                  height: "30%",
                  width: "100%",
                  marginTop: "10px",
                  //backgroundColor: "rgb(203, 231, 253)",
                }}
              >
                <Grid
                  container
                  direction="column"
                  alignItems="center"
                  style={{
                    height: "100%",
                    width: "100%",
                  }}
                >
                  <Grid
                    container
                    style={{
                      height: "45%",
                      width: "100%",
                      //backgroundColor: "rgb(103, 131, 153)",
                    }}
                  >
                    appartamento 1
                  </Grid>
                  <Grid
                    container
                    style={{
                      height: "55%",
                      width: "100%",
                      //backgroundColor: "rgb(3, 231, 153)",
                    }}
                  >
                    <Grid
                      container
                      alignItems="center"
                      style={{
                        height: "100%",
                        width: "100%",
                        backgroundColor: "rgb(3, 231, 153)",
                      }}
                    >
                      <Grid
                        container
                        direction="row"
                        alignItems="center"
                        style={{
                          height: "100%",
                          width: "49%",
                          backgroundColor: "rgb(13, 131, 53)",
                        }}
                      ></Grid>
                      <Divider orientation="vertical" flexItem></Divider>
                      <Grid
                        container
                        direction="row"
                        alignItems="center"
                        style={{
                          height: "100%",
                          width: "50%",
                          backgroundColor: "rgb(33, 131, 117)",
                        }}
                      ></Grid>
                    </Grid>
                  </Grid>
                </Grid>
              </Grid>
              <Grid
                style={{
                  height: "30%",
                  width: "100%",
                  marginTop: "10px",
                  backgroundColor: "rgb(203, 231, 253)",
                }}
              ></Grid>
            </Grid>
          </Grid>
          <Divider orientation="vertical" flexItem />
          <Grid
            container
            direction="column"
            style={{
              display: "flex",
              alignItems: "center",
              justifyContent: "center",
              height: "90vh",
              width: "35vw",
            }}
          >
            <Grid
              style={{
                height: "10%",
              }}
            >
              <Typography
                variant="h4"
                color="rgb(0, 76, 134)"
                sx={{ fontWeight: "bold" }}
              >
                Nuovo appartamento
              </Typography>
            </Grid>
            <Grid
              container
              direction="column"
              justifyContent="center"
              alignItems="center"
              style={{
                height: "90%",
                width: "90%",
              }}
            >
              <Grid
                container
                direction="column"
                justifyContent="flex-end"
                alignItems="center"
                style={{
                  width: "90%",
                  height: "40%",
                }}
              >
                <Button
                  variant="solid"
                  style={{ background: "rgb(0, 76, 134)" }}
                  onClick={() => {
                    console.log("hola");
                  }}
                >
                  Crea nuovo appartamento
                </Button>
                <Grid
                  style={{
                    width: "90%",
                    height: "10%",
                  }}
                ></Grid>
              </Grid>
              <Divider flexItem />
              <Grid
                container
                direction="column"
                justifyContent="flex-start"
                alignItems="center"
                style={{
                  width: "90%",
                  height: "50%",
                }}
              >
                <Grid
                  style={{
                    width: "90%",
                    height: "5%",
                  }}
                ></Grid>
                <TextField
                  id="standard-basic"
                  label="Codice identificativo"
                  variant="standard"
                />
                <Grid
                  style={{
                    width: "90%",
                    height: "5%",
                  }}
                ></Grid>
                <Button
                  variant="solid"
                  style={{ background: "rgb(0, 76, 134)" }}
                  onClick={() => {
                    console.log("hola");
                  }}
                >
                  Unisciti nuovo appartamento
                </Button>
              </Grid>
            </Grid>
          </Grid>
        </Grid>
      </Container>
    </Container>
  );
}
